function filterData(data) {
	return data.filter(f => Object.keys(filters)
		.reduce((keep, key) => {
			if (
				!keep ||
				filters[key] === null
			) return keep;

			if (typeof filters[key] === 'string') {
				return filters[key] === f[key];
			}

			if (Array.isArray(filters[key])) {
				return filters[key].indexOf(f[key]) !== -1;
			}

			if (typeof filters[key] === 'function') {
				return filters[key](f[key], f);
			}

			console.log(`INVALID FILTER - ${key}`);
			return false;
		}, true));
}

let isUpdatingBefore = false;
function updateData(direction = 'after') {
	let apiUrl = '/api';
	if (typeof nextDataFields.after !== 'undefined') {
		apiUrl += '?'
		if (direction === 'after') {
			apiUrl += `after=${nextDataFields.after}`;
		} else {
			isUpdatingBefore = true;
			apiUrl += `before=${nextDataFields.before}&continue=${encodeURIComponent(nextDataFields.continue)}`
		}
	}
	fetch(apiUrl)
		.then((r) => r.json())
		.then((r) => {
			if (
				r.before &&
				(
					!nextDataFields.before ||
					nextDataFields.before > r.before
				)
			) {
				nextDataFields.before = r.before;
				nextDataFields.continue = r.continueToken;
			}

			if (
				r.after &&
				(
					!nextDataFields.after ||
					nextDataFields.after < r.after
				)
			) {
				nextDataFields.after = r.after;
			}

			r.data = r.data.map((f) => ({
				...f,
				Local: dateToStr(new Date(f.Datetime)),
				File: f.Key.split('/')[1]
			}));
			if (direction === 'before') {
				files = [
					...files,
					...r.data
				];
			} else {
				files = [
					...r.data,
					...files
				];
			}
			files = filterData(files);
			display(filterData(r.data), direction);
		})
		.catch(console.error)
		.then(() => {
			if (direction === 'after') {
				setTimeout(updateData, dataUpdateFrequency, 'after');
			} else {
				isUpdatingBefore = false;
			}
		});
}

updateData();

function getFileIndex(file) {
	return files.reduce(
		(i, f, index) => f.File === file
			? index
			: i,
		-1
	);
}

function padLeft(value) {
	return value.toString().padStart(2, '0');
}

function secondsToString(seconds) {
	if (typeof seconds === 'undefined' || seconds === null) {
		return '';
	}

	return `${seconds}s`;
}

function isInView(row) {
	const container = document.getElementById('container');
	const rec1 = row.getBoundingClientRect();
	const rec2 = container.getBoundingClientRect();

	if (
		rec1.y + rec1.height >= rec2.y + rec2.height ||
		rec1.y < rec2.y
	) {
		return false;
	}
	return true;
}

function markRowAsPlaying(file) {
	[ ...document.querySelectorAll('tr') ]
		.forEach((row) => row.classList.remove('table-success'));

	const playingRow = document.getElementById(file);
	if (playingRow !== null) {
		playingRow.classList.add('table-success');
	}
}

function scrollRowIntoView(f) {
	const elemToScrollTo = document.getElementById(f);
	const newScroll = window.scrollY + elemToScrollTo.getBoundingClientRect().top - 80;
	window.scrollTo(0, newScroll);
}

let isInit = true;
function display(dataToDisplay, location) {
	const rows = dataToDisplay
		.map((file) => [
			`<tr id="${file.File}" onclick="play('${file.File}');">`,
			[
				secondsToString(file.Len),
				sourceMap[file.Source] || file.Source,
				file.Local,
				file.Tone ? '<i class="bi bi-star-fill"></i>' : ''
			]
				.map((cell) => `<td>${cell}</td>`)
				.join(''),
			`</tr>`
		].join(''))
		.join('\n');

	let newHtml = document.getElementById('files').innerHTML;
	if (location === 'before') {
		newHtml += rows;
	} else {
		newHtml = `${rows}${newHtml}`;
	}
	document.getElementById('files').innerHTML = newHtml;

	if (player.file) {
		const index = getFileIndex(player.file);
		if (playNewFiles && index > 1) {
			play(files[index - 1].File);
		} else {
			markRowAsPlaying(player.file);
		}
	}

	if (isInit) {
		isInit = false;
		let u = new URL(window.location.href);
		let f = u.searchParams.get('f');
		if (f !== null && document.getElementById(f) !== null) {
			scrollRowIntoView(f);
			play(f);
		} else {
			playLastTone();
		}
	}
}

const player = document.getElementById('player');
const playerProgress = document.getElementById('player-progress');
const playerButtons = [
	document.getElementById('play-button-m'),
	document.getElementById('play-button-d')
];

let playButtonAction = 'play';
playerButtons.forEach((button) => {
	button.addEventListener('click', () => {
		if (playButtonAction === 'play') {
			player.play();
		} else {
			player.pause();
		}
	});
});
let playNewFiles = false;

const playerDuration = document.getElementById('player-duration');
player.addEventListener('durationchange', () => playerDuration.innerHTML = `${Math.round(player.duration)} sec`);

player.addEventListener('play', () => {
	playButtonAction = 'pause';
	playerButtons.forEach((button) => {
		const bi = button.querySelector('.bi');
		bi.classList.add('bi-pause-fill');
		bi.classList.remove('bi-play-fill');
	});
});

player.addEventListener('pause', () => {
	playButtonAction = 'play';
	playerButtons.forEach((button) => {
		const bi = button.querySelector('.bi');
		bi.classList.add('bi-play-fill');
		bi.classList.remove('bi-pause-fill');
	});
});

const playerBar = document.getElementById('player-progress');
player.addEventListener('timeupdate', () => {
	const newPercent = Math.round(player.currentTime * 100 / player.duration);
	playerBar.style.width = `${newPercent}%`;
});

player.addEventListener('ended', async () => {
	if (!player.file) {
		return;
	}

	const index = getFileIndex(player.file);
	if (index < 1) {
		playNewFiles = true;
		return;
	}

	play(files[index - 1].File);
});

function play(file) {
	const data = files.filter((f) => f.File === file)[0];
	if (typeof data === 'undefined') {
		return;
	}

	playNewFiles = false;
	player.file = file;

	player.src = `https://fire.klawil.net/${data.Key}`;
	player.play();

	markRowAsPlaying(file);

	setParams({
		f: data.File
	});
}

function setParams(toSet) {
	let currentParams = document.location.search.slice(1)
		.split('&')
		.filter((v) => v !== '')
		.reduce((p, v) => {
			v = v.split('=');
			if (v.length < 2) {
				v.push('');
			}

			return {
				...p,
				[decodeURIComponent(v[0])]: decodeURIComponent(v[1])
			}
		}, {});

	let newParams = {
		...currentParams,
		...toSet
	};

	let newString = Object.keys(newParams)
		.sort()
		.map((key) => `${encodeURIComponent(key)}=${encodeURIComponent(newParams[key])}`)
		.join('&');
	if (newString !== '') {
		newString = `?${newString}`;
	}

	if (document.location.search !== newString) {
		history.replaceState(null, null, newString);
	}
}

function playLastTone() {
	let lastTone = files.filter((file) => file.Tone)[0];

	if (lastTone) {
		play(lastTone.File);
		scrollRowIntoView(lastTone.File);
	}
}

document.getElementById('latest-button-m').addEventListener('click', playLastTone);
document.getElementById('latest-button-d').addEventListener('click', playLastTone);

window.addEventListener('scroll', () => {
	if (isUpdatingBefore) return;

	const scrollY = window.scrollY;
	const winHeight = window.innerHeight;
	const bodyHeight = document.body.getBoundingClientRect().height;

	if (scrollY + winHeight >= bodyHeight) {
		updateData('before');
	}
});
